INSERT INTO `categories` VALUES (1,'écriture','<p>PLANET DESIGN vous propose une gamme &eacute;toff&eacute;e de stylos publicitaires indispensables au quotidien et en toutes circonstances.<br />\r\nD&eacute;couvrez notre s&eacute;lection de ce gadget populaire avec plusieurs fonctionnalit&eacute;s utiles :</p>\r\n\r\n<ul>\r\n	<li>Les stylos promotionnels pas cher (stylos en plastique, stylos en m&eacute;tal, stylos &eacute;cologiques, stylos comptoir, parure de stylos, stylos porte t&eacute;l&eacute;phone, stylos torche, stylos pointeur&hellip;)</li>\r\n	<li>Les crayons et crayons de couleurs avec logo</li>\r\n	<li>Les surligneurs et fluorescents personnalis&eacute;s</li>\r\n</ul>\r\n\r\n<p>Et pour mieux vous servir, nous mettons &agrave; votre disposition notre parc de machines d&rsquo;impressions d&eacute;di&eacute; &agrave; l&rsquo;impression digital / UV (impression quadri), la tampographie et le marquage laser qui sont les techniques d&rsquo;impressions utilis&eacute;es pour les stylos publicitaires de toute cat&eacute;gorie.</p>',NULL,'2023-08-16 12:48:25','2023-09-15 10:15:55',147,1),(2,'bureau & event','<p>Nous vous proposons dans cette cat&eacute;gorie d&rsquo;objets publicitaires, un large choix de cadeaux d&rsquo;affaires &agrave; offrir pour des &eacute;v&egrave;nements entreprises mais aussi gadgets personnalis&eacute;s &agrave; poser sur le bureau de votre partenaire ou un accessoire personnalisable d&rsquo;une grande utilit&eacute; et portable partout o&ugrave; votre partenaire s&rsquo;y rend.<br />\r\nDans BUREAU &amp; EVENTS vous aurez &agrave; votre disposition plusieurs id&eacute;es cadeaux originaux dans la cat&eacute;gorie COFFRETS publicitaires, des gadgets publicitaire de budget abordables pour le bureau tels les cubes &agrave; papier personnalisables, des pots &agrave; crayons publicitaires, des antistress&hellip;, et des gadgets accessoires de poche comme les porte-cl&eacute;s publicitaires et porte-cartes de visite. Nous vous offrons un choix de notebooks personnalisables et conf&eacute;renciers publicitaires. Ainsi, pour les &eacute;v&egrave;nements de grandes envergures, nous avons aussi s&eacute;lectionn&eacute; pour vous une gamme vari&eacute;e de troph&eacute;es &agrave; personnaliser et sacs publicitaires.</p>',NULL,'2023-08-16 12:49:57','2023-09-15 09:49:58',134,2),(3,'pause gourmande','<p>PLANET DESIGN vous propose une gamme diversifi&eacute;e de mugs et thermos pour profiter des temps de repos des &eacute;quipes, et m&ecirc;me en dehors des bureaux afin de mettre en valeur une identit&eacute; visuelle et de l&rsquo;associer au bien &ecirc;tre que peut pr&eacute;senter le caf&eacute; ou le th&eacute; ou n&rsquo;importe quelle boisson appr&eacute;ci&eacute;s. Aussi, vous pouvez proposer &agrave; vos clients des sacs isothermes ou des boites &agrave; repas qui permettront de transporter leurs repas dans les meilleures des conditions.</p>',NULL,'2023-08-16 12:50:40','2023-09-15 10:05:17',26,3),(4,'téchnologie','<p>La technologie aujourd&rsquo;hui est au c&oelig;ur de toutes les discussions, c&rsquo;est pourquoi PLANET DESIGN fait en sorte de proposer des gadgets High-Tech &agrave; la pointe des derni&egrave;res tendances technologiques mondiales.<br />\r\nNous avons une large offre de familles des gadgets technologiques afin de satisfaire tous les go&ucirc;ts en respectant les budgets. Allant d&rsquo;un simple accessoire t&eacute;l&eacute;phonique, jusqu&rsquo;&agrave; des coffrets prestigieux et innovants en passant par des Power-Banks, USB et Haut-parleurs et m&ecirc;me une gamme d&eacute;di&eacute;e &agrave; l&rsquo;horlogerie.<br />\r\nEt pour mieux vous servir, nous vous proposons de consulter notre &eacute;quipe commerciale pour mieux vous orienter sur les techniques d&rsquo;impressions et marquage pour que vos objets high-tech apportent satisfaction &agrave; l&rsquo;&oelig;il ainsi qu&rsquo;&agrave; son utilit&eacute;.</p>',NULL,'2023-08-16 12:51:44','2023-09-15 10:01:14',33,4),(5,'Loisirs & bien être','<p>PLANET DESIGN vous sugg&egrave;re des objets publicitaires destin&eacute;s aux activit&eacute;s sportives, au bricolage,<br />\r\ndes gadgets pour voiture, des goodies utilis&eacute;s en voyage et sur la route, les vacances d&rsquo;&eacute;t&eacute; avec la<br />\r\nfamille et les amis pour joindre l&rsquo;utile &agrave; l&rsquo;agr&eacute;able et profiter des bons moments de d&eacute;tente pour<br />\r\nam&eacute;liorer la visibilit&eacute; de vos partenaires.</p>',NULL,'2023-08-16 12:52:33','2023-09-15 09:50:13',30,5),(6,'textile','<p>Le textile publicitaire restera pour toujours un excellent moyen de communication pour les Les T-shirts promotionnels, les polos publicitaires, les casquettes sont souvent utilis&eacute;s dans des &eacute;v&eacute;nements mais aussi &agrave; offrir aux clients. C&rsquo;est l&rsquo;objet publicitaire le plus remarqu&eacute; et il permet une visibilit&eacute; mobile sans pr&eacute;c&eacute;dente.<br />\r\nLes v&ecirc;tements de travail habilleront une &eacute;quipe de fa&ccedil;on harmonieuse et professionnelle ainsi leur permettant une s&eacute;curit&eacute; au quotidien. D&eacute;couvrez notre gamme personnalisable en s&eacute;rigraphie, transfert ou broderie pour donner un booste &agrave; la notori&eacute;t&eacute;.</p>',NULL,'2023-08-16 12:53:16','2023-09-15 09:23:17',24,6),(7,'agenda & notebook','<p>PLANET DESIGN a s&eacute;lectionn&eacute; pour vous des gammes diversifi&eacute;es de notebooks personnalis&eacute;s : des notebooks technologiques avec power-bank de la nouvelle g&eacute;n&eacute;ration avec et sans induction, des notebooks personnalisables avec USB, des notebook A5 avec couverture en similicuir personnalisable, des notebooks &eacute;cologiques, des notebooks avec post-it int&eacute;gr&eacute;s, des notebooks de type moleskine, des notebooks de prestige en coffret avec stylo.<br />\r\nConcernant les agendas personnalis&eacute;s, nous vous proposons chaque ann&eacute;e des mod&egrave;les sur production avec les sp&eacute;cificit&eacute;s demand&eacute;es.</p>',NULL,'2023-08-16 16:24:10','2023-09-13 17:06:08',1,7),(8,'coffret publicitaire','<p>Le coffret publicitaire est le cadeau d&rsquo;affaires id&eacute;al pour remercier vos partenaires pour votre collaboration. PLANET DESIGN vous propose une gamme diversifi&eacute;e de coffrets vari&eacute;s et compos&eacute;s de 2 pi&egrave;ces, 3 pi&egrave;ces, 4 pi&egrave;ces et plus tels que : des coffrets porte-cartes de visite, stylo publicitaire, porte-cl&eacute;s promotionnel, coffrets technologiques, des coffrets notebooks haut de gamme&hellip;<br />\r\nD&eacute;filez l&rsquo;ensemble des coffrets corporate disponibles en stock.</p>',NULL,'2023-08-16 16:28:06','2023-09-05 14:43:54',0,8),(9,'mug & thermo','<p>A tout moment de l&rsquo;ann&eacute;e nous appr&eacute;cions boire nos boissons chaudes assez chaudes. Voil&agrave; l&rsquo;int&eacute;r&ecirc;t de proposer des mugs et des thermos pendant toute l&rsquo;ann&eacute;e avec la personnalisation appropri&eacute;e.<br />\r\nConsultez-nous pour tous les objets publicitaires disponibles sur notre site et m&ecirc;me vos demandes sp&eacute;ciales sur importation. Nous serons &agrave; votre disposition !!</p>',NULL,'2023-08-16 16:29:27','2023-09-05 14:43:54',0,9),(10,'usb publicitaire','<p>L&rsquo;outil technologique le plus populaire, pratique et utile dans le monde o&ugrave; nous &eacute;voluons. L&rsquo;USB publicitaire permet d&rsquo;&eacute;changer les donn&eacute;es et les documents de travail volumineux d&rsquo;un poste &agrave; un autre et d&rsquo;un endroit &agrave; un autre en toute vitesse.<br />\r\nPLANET DESIGN, dispose d&rsquo;un stock d&rsquo;USB de diff&eacute;rentes capacit&eacute;s (8GB &ndash; 16GB &ndash; autres sur commande) et de multi-usages (Android type B, Type C, &agrave; mousqueton, &agrave; porte-cl&eacute;s&hellip;.) &agrave; personnaliser avec nos possibilit&eacute;s d&rsquo;impression pour chaque mod&egrave;le.<br />\r\nNous avons aussi la possibilit&eacute; sur importation de vous proposer des USB publicitaire personnalisable &agrave; l&rsquo;extr&ecirc;me en forme de coupe, marque, message, visuel, objet&hellip;</p>',NULL,'2023-08-16 16:30:41','2023-09-05 14:43:54',0,10),(11,'pharma & santé','<p>En attente du text</p>',NULL,'2023-08-16 16:32:24','2023-09-05 14:43:54',1,11);
/*!40000 ALTER TABLE `categories` ENABLE KEYS */;
