INSERT INTO `subcategories` VALUES (1,1,'crayons publicitaires','<p>&ldquo;Se tromper est humain, mais lorsque la gomme s&rsquo;use plus vite que le crayon, c&rsquo;est qu&rsquo;on exag&egrave;re.&rdquo;<br />\r\nPLANET DESIGN vous offre le choix entre des crayons publicitaires avec ou sans gomme. Des grands crayons et des mini-crayons tr&egrave;s pratiques. Une pens&eacute;e pour les enfants afin de rendre leurs dessins et r&ecirc;ves vrais et joyeux gr&acirc;ce aux crayons de couleurs.<br />\r\nVous pouvez marquer vos crayons au laser pour garder cet effet naturel ou bien donner de l&rsquo;&eacute;clat avec une impression du logo en tampographie ou avec de l&rsquo;impression UV.</p>',NULL,'2023-08-16 17:30:45','2023-09-14 10:40:46',8),(2,1,'surligneurs publicitaires','<p>SURLIGNEZ VOS ACTIONS PRINCIPALES !<br />\r\nPLANET DESIGN met &agrave; votre disposition sa ligne de surligneurs et fluorescents avec d&rsquo;autres fonctionnalit&eacute;s compl&eacute;mentaires pour faciliter la t&acirc;che de son acqu&eacute;reur.<br />\r\nLa technique d&rsquo;impressions utilis&eacute;e d&eacute;pend de chaque mod&egrave;le &agrave; savoir : la s&eacute;rigraphie, le digital et la r&eacute;sine autocollante.</p>',NULL,'2023-08-16 17:54:45','2023-09-14 10:40:37',6),(3,1,'stylos torche & laser','<p>PLANET DESIGN vous propose des stylos publicitaires avec d&rsquo;autres fonctionnalit&eacute;s utiles dans divers domaines professionnels mais aussi de la vie quotidienne. A savoir :</p>\r\n\r\n<ul>\r\n	<li>Les stylos torche personnalisable en tampographie, digital ou laser. Ce gadget est tr&egrave;s utile. Il permet &agrave; vos clients d&rsquo;offrir de la lumi&egrave;re utile &agrave; des moments critiques (perte d&rsquo;objets dans le noir, mieux voir quand il fait sombre&hellip;).</li>\r\n	<li>Les stylos pointeur ou stylos laser tr&egrave;s utilis&eacute;s dans le monde professionnel, dans les s&eacute;minaires et congr&egrave;s.</li>\r\n</ul>',NULL,'2023-08-16 17:56:20','2023-09-14 10:39:54',5),(4,1,'stylos bois & ecologique','<p>Une s&eacute;lection de stylos &eacute;cologiques pour un choix &eacute;co-responsable. Notre &eacute;cosyst&egrave;me l&rsquo;exige !<br />\r\nPLANET DESIGN participe &agrave; la sauvegarde de notre &eacute;cosyst&egrave;me avec une gamme diversifi&eacute;e de stylos &eacute;cologiques :<br />\r\nDes stylos en bambou, des stylos en pailles de bl&eacute;, des stylos en papier recyclable, des stylos en bois recyclable, des stylos en plastique recyclable, des stylos en m&eacute;tal recyclable &hellip; tous &agrave; personnaliser sans mod&eacute;ration pour r&eacute;pondre aux besoins des institutions qui adh&eacute;rent &agrave; une plan&egrave;te saine et &eacute;quilibr&eacute;e.</p>',NULL,'2023-08-16 17:57:19','2023-09-14 10:37:49',3),(5,1,'stylos comptoir','<p>PLANET DESIGN vous offre une gamme diversifi&eacute;e de stylos comptoir en plastique et en m&eacute;tal qui sont tr&egrave;s utiles sur les comptoirs et les bureaux de haute fr&eacute;quentation.<br />\r\nLes stylos de comptoir sont personnalisables en s&eacute;rigraphie, au laser, adh&eacute;sif en quadri et &agrave; la r&eacute;sine pour mettre en avant le logo de votre client chez ses partenaires.</p>',NULL,'2023-08-16 17:58:05','2023-09-14 10:39:54',4),(6,1,'stylos en plastique','<p>Qui d&rsquo;entre nous qui n&rsquo;utilise pas de stylos &agrave; billes&nbsp;!<br />\r\nPLANET DESIGN vous propose non seulement une large gamme des stylos promotionnels en plastique pas cher (stylos en soft-touch, Stylus personnalisable, stylos porte t&eacute;l&eacute;phone avec logo &hellip;)<br />\r\nMais, elle vous propose aussi son service de marquage du logo en s&eacute;rigraphie (tampographie), digital (UV/QUADRI).<br />\r\nNos stylos publicitaires sont majoritairement d&rsquo;encre bleue assez fluide pour offrir une aisance &agrave; l&rsquo;&eacute;criture et vous en trouverez certainement un de nos stylos publicitaires qui correspond au gout de votre client.</p>',NULL,'2023-08-16 18:04:31','2023-09-14 10:37:39',1),(7,1,'stylos métallique','<p>Mieux qu&rsquo;un simple stylo en m&eacute;tal, aujourd&rsquo;hui, c&rsquo;est un accessoire personnalisable indispensable !<br />\r\nPLANET DESIGN choisit pour vous les derniers designs de stylos en m&eacute;tal les plus tendance &agrave; l&rsquo;international et les met &agrave; votre disposition pour r&eacute;pondre aux besoins urgents de vos clients en mati&egrave;re d&rsquo;objets publicitaires grand public.<br />\r\nLes stylos publicitaires laserables en soft-touch sont la tendance du march&eacute; actuellement. D&eacute;couvrez nos gammes en diff&eacute;rents styles et couleurs.</p>',NULL,'2023-08-16 18:05:35','2023-09-14 10:37:43',2),(8,1,'parures de stylos','<p>Il existe toujours les amoureux des stylos m&eacute;tallique DUO en coffret. La noblesse est &eacute;ternelle !<br />\r\nA l&rsquo;int&eacute;rieur du coffret publicitaire, vous avez deux stylos en m&eacute;tal tr&egrave;s chic que vous pouvez personnaliser avec un logo au laser ou marquer les initiales d&rsquo;un nom et pr&eacute;nom. Le 1er est un stylo &agrave; bille et le 2&egrave;me est un stylo &agrave; encre ou &agrave; plume qui garde leur fid&egrave;le toujours et encore.</p>',NULL,'2023-08-16 18:07:32','2023-09-14 10:40:42',7),(10,2,'Accessoires de poche','<p>Chez PLANET DESIGN, les accessoires de poche regroupent tous les gadgets promotionnels pas chers et tr&egrave;s utilis&eacute;s au quotidien. Ces goodies de poche imprimables constituent une v&eacute;ritable force pour communiquer aupr&egrave;s d&rsquo;un large public<br />\r\nD&eacute;couvrez l&rsquo;ensemble de nos gammes accessoires de poche tels que les porte-cl&eacute;s, les porte-cartes de visite, les mousquetons, porte-sac, porte-cl&eacute;s torche&hellip;</p>',NULL,'2023-08-28 15:46:47','2023-09-14 10:42:05',9),(11,2,'badges & tours de cou','<p>Les badges nominatifs et tours de cou personnalisables sont incontournables dans l&rsquo;organisation d&rsquo;&eacute;v&egrave;nements, festivals, congr&egrave;s et salons professionnels pour accroitre la visibilit&eacute; aupr&egrave;s d&rsquo;un large public.</p>',NULL,'2023-08-30 11:32:40','2023-09-14 10:42:12',10),(12,2,'coffret publicitaire','<p>Le coffret publicitaire est le cadeau d&rsquo;affaires id&eacute;al pour remercier vos partenaires pour votre collaboration. PLANET DESIGN vous propose une gamme diversifi&eacute;e de coffrets vari&eacute;s et compos&eacute;s de 2 pi&egrave;ces, 3 pi&egrave;ces, 4 pi&egrave;ces et plus tels que : des coffrets porte-cartes de visite, stylo publicitaire, porte-cl&eacute;s promotionnel, coffrets technologiques, des coffrets notebooks haut de gamme&hellip;<br />\r\nD&eacute;filez l&rsquo;ensemble des coffrets corporate disponibles en stock.</p>',NULL,'2023-08-30 12:10:55','2023-09-14 10:42:21',11),(13,2,'conférenciers porte-document','<p>Pour vos &eacute;v&eacute;nements d&rsquo;entreprise tels que les conf&eacute;rences, les congr&egrave;s, les s&eacute;minaires et les r&eacute;unions. Le conf&eacute;rencier avec le logo de votre client sera votre meilleur conseil.<br />\r\nLe porte document est aussi un grand indispensable pour les &eacute;v&eacute;nements d&rsquo;entreprises.</p>',NULL,'2023-08-30 14:29:08','2023-09-14 10:42:31',12),(14,2,'gadgets de bureau','<p>Les gadgets de bureau publicitaires rassemblent une large famille d&rsquo;objets publicitaires &agrave; d&eacute;poser sur le bureau pour &ecirc;tre constamment &agrave; port&eacute;e de vue par le client.<br />\r\nNous avons plusieurs gadgets pour bureau dans cette cat&eacute;gorie&nbsp;&agrave; savoir&nbsp;: le pot &agrave; crayon, l&rsquo;antistress, les post-it, la maroquinerie de bureau, les cubes, les porte-cartes de visite, les pr&eacute;sentoirs&hellip;.<br />\r\nD&eacute;couvrez l&rsquo;ensemble de ces accessoires de bureaux personnalisables en d&eacute;filant sur cette page.</p>',NULL,'2023-08-30 15:08:30','2023-09-14 10:42:46',13),(15,2,'note books & agendas','<p><strong>PLANET DESIGN</strong> a s&eacute;lectionn&eacute; pour vous des gammes diversifi&eacute;es de notebooks personnalis&eacute;s : des notebooks technologiques avec power-bank de la nouvelle g&eacute;n&eacute;ration avec et sans induction, des notebooks personnalisables avec USB, des notebook format A5 avec couverture en similicuir personnalisable, des note-books &eacute;cologiques, des blocs-notes avec post-it int&eacute;gr&eacute;s, des note-books de type moleskine, des coffrets notebooks de prestige avec stylo.<br />\r\nConcernant les agendas personnalis&eacute;s, nous vous proposons chaque ann&eacute;e des mod&egrave;les sur production avec les sp&eacute;cificit&eacute;s demand&eacute;es.</p>',NULL,'2023-09-07 12:53:56','2023-09-14 10:42:55',14),(16,2,'sacs shopping publicitaires','<p>Depuis que les sacs en plastique sont interdits, les sacs publicitaires en polypropyl&egrave;ne et en tissu sont devenus tr&egrave;s appr&eacute;ci&eacute;s et utilis&eacute;s par tout le monde et dans toutes les activit&eacute;s. Contrairement aux sacs en carton, les sacs en tissu sont r&eacute;sistants &agrave; l&rsquo;usage et ils sont m&ecirc;me lavables en gardant la personnalisation intacte apr&egrave;s plusieurs lavages.<br />\r\nD&eacute;couvrez nos mod&egrave;les et couleurs disponibles en stock.</p>',NULL,'2023-09-07 13:57:35','2023-09-14 10:43:09',15),(17,2,'trophées & medailles','<p>Lors d&rsquo;un &eacute;v&egrave;nement d&rsquo;entreprise, un d&eacute;part en retraite, une comp&eacute;tition sportive ou pour r&eacute;compenser un collaborateur, vous pouvez opter pour les troph&eacute;es et les m&eacute;dailles et porter un message de f&eacute;licitation ou d&rsquo;encouragement. Le destinataire gardera ce cadeau en souvenir de l&rsquo;occasion.</p>',NULL,'2023-09-07 14:16:37','2023-09-14 10:43:19',16),(18,3,'Thermos & mugs publicitaires','<p>A tout moment de l&rsquo;ann&eacute;e nous appr&eacute;cions boire nos boissons chaudes assez chaudes. Voil&agrave; l&rsquo;int&eacute;r&ecirc;t de proposer des mugs et des thermos pendant toute l&rsquo;ann&eacute;e avec la personnalisation appropri&eacute;e.<br />\r\nConsultez-nous pour tous les objets publicitaires disponibles sur notre site et m&ecirc;me vos demandes sp&eacute;ciales sur importation. Nous serons &agrave; votre disposition !!</p>',NULL,'2023-09-08 12:02:21','2023-09-14 10:35:16',17),(19,3,'mugs en porcelaine','<p>Le mug en porcelaine est le gadget le plus populaire dans sa cat&eacute;gorie, c&rsquo;est un objet pas cher et tr&egrave;s utile au bureau et m&ecirc;me &agrave; la maison. C&rsquo;est pour cette raison que nous vous proposons une famille de diff&eacute;rents mod&egrave;les et couleurs pour satisfaire tous les go&ucirc;ts.</p>',NULL,'2023-09-08 13:00:50','2023-09-14 10:44:23',20),(20,3,'gourdes & bouteilles','<p>Les gourdes et les bouteilles sont tr&egrave;s utiles, r&eacute;utilisables et transportable gr&acirc;ce &agrave; leur mousqueton ou dragonne. D&rsquo;ailleurs c&rsquo;est un objet qui n&rsquo;a pas d&rsquo;&acirc;ge : il sert pour les grands et les petits !!<br />\r\nProposez cet objet publicitaire &agrave; prix tr&egrave;s int&eacute;ressant &agrave; vos clients. Son identit&eacute; pourra accompagner ses collaborateurs partout o&ugrave; ils se trouveront.</p>',NULL,'2023-09-08 13:23:35','2023-09-14 10:42:05',18),(21,3,'sacs isothermes & boites repas','<p>Les sacs isotherme et boite repas sont des gadgets indispensables pour les personnes qui emportent la nourriture fra&icirc;che lors des sorties comme la plage, un pique-nique ou m&ecirc;me au travail.<br />\r\nPLANET DESIGN vous propose des id&eacute;es cadeaux tr&egrave;s appr&eacute;ci&eacute;s, peu co&ucirc;teux et surtout tr&egrave;s utile pour joindre l&rsquo;utile &agrave; l&rsquo;agr&eacute;able.</p>',NULL,'2023-09-08 14:23:17','2023-09-14 10:44:11',19),(22,4,'Accessoires high-tech','<p>Les accessoires high-tech sont tr&egrave;s cot&eacute;s dans le domaine de la communication par l&rsquo;objet. Ce sont des outils de communication pas cher avec une possibilit&eacute; de distribution de masse dans les actions commerciales.<br />\r\nPLANET DESIGN a s&eacute;lectionn&eacute; pour vous dans cette rubrique des gadgets high-tech pour ordinateur et pour t&eacute;l&eacute;phone comme le hub, porte t&eacute;l&eacute;phone, brassard t&eacute;l&eacute;phone, lampe LED&hellip; et d&rsquo;autres goodies fonctionnels.</p>',NULL,'2023-09-11 10:49:53','2023-09-14 10:46:05',25),(23,4,'coffret high-tech','<p>PLANET DESIGN vous offre une gamme vari&eacute;e de Coffrets high-tech pour proposer &agrave; vos clients une panoplie de cadeaux d&rsquo;affaires prestigieux, tendance et utile &agrave; l&rsquo;utilisateur comme des coffrets notebooks technologiques, des coffrets porte-documents avec power-Bank, des coffrets USB-stylos&hellip; et d&rsquo;autres id&eacute;es cadeaux pour bureau &agrave; composer.<br />\r\nGrace &agrave; sa personnalisation avec le logo, le coffret technologique sera votre alli&eacute; pour augmenter la visibilit&eacute; et la notori&eacute;t&eacute; de votre client.</p>',NULL,'2023-09-11 11:08:27','2023-09-14 10:45:28',22),(24,4,'Haut parleurs & casques','<p>Les haut-parleurs, speakers publicitaire et &eacute;couteurs en Bluetooth sont des objets technologiques tr&egrave;s pris&eacute;s. Tr&egrave;s utiles et facilement transportable, d&eacute;couvrez cette gamme qui sera votre atout pour se d&eacute;marquer et proposer une alternative au bien-&ecirc;tre et d&rsquo;apporter du rythme &agrave; la vie des collaborateurs.<br />\r\nNotre gamme va d&rsquo;une simple fonctionnalit&eacute; de haut-parleurs &agrave; des multi-usages comme en plus de la fonctionnalit&eacute; musicale, vous avez un chargeur &agrave; induction ou porte-tel et m&ecirc;me avec la possibilit&eacute; de v&eacute;hiculer une adaptation de visuel d&rsquo;une compagne de communication de votre client.</p>',NULL,'2023-09-11 11:14:20','2023-09-14 10:45:53',24),(25,4,'Horlogeries publicitaires','<p>D&eacute;couvrez notre s&eacute;lection d&rsquo;horlogerie murale et de bureau qui est un objet promotionnel ind&eacute;modable.<br />\r\nCe gadget publicitaire est un excellent support de communication dans les salles d&rsquo;attente, les magasins de comptoirs, les bureaux, &agrave; la maison &hellip; enfin partout !</p>',NULL,'2023-09-11 11:30:08','2023-09-14 10:46:09',26),(26,4,'Powerbank & chargeurs','<p>Jamais plus de batterie faible, gr&acirc;ce aux Power-Banks et chargeurs &agrave; inductions que nous vous proposons comme solution &agrave; votre client. Pour ces collaborateurs, employ&eacute;s et clients, les batteries externes font l&rsquo;affaire du si&egrave;cle.<br />\r\nProposez nos batteries de secours &agrave; vos clients d&eacute;pendamment de leurs budgets. Des capacit&eacute;s de chargement vari&eacute;es de 2000 mAh allant jusqu&rsquo;&agrave; 10000 mAh avec aussi une s&eacute;lection de chargeurs &agrave; induction avec d&rsquo;autres fonctionnalit&eacute;s comme le pot &agrave; stylo, porte notes, horloge de bureau et d&rsquo;autres fonctionnalit&eacute;s qui sont adapt&eacute;s aux smartphones de la nouvelle g&eacute;n&eacute;ration.</p>',NULL,'2023-09-11 11:42:01','2023-09-14 10:45:13',21),(27,4,'Clés usb publicitaires','<p>L&rsquo;outil technologique le plus populaire, pratique et utile dans le monde o&ugrave; nous &eacute;voluons. L&rsquo;USB publicitaire permet d&rsquo;&eacute;changer les donn&eacute;es et les documents de travail volumineux d&rsquo;un poste &agrave; un autre et d&rsquo;un endroit &agrave; un autre en toute vitesse.<br />\r\nPLANET DESIGN, dispose d&rsquo;un stock d&rsquo;USB de diff&eacute;rentes capacit&eacute;s (8GB &ndash; 16GB &ndash; autres sur commande) et de multi-usages (Android type B, Type C, &agrave; mousqueton, &agrave; porte-cl&eacute;s&hellip;.) &agrave; personnaliser avec nos possibilit&eacute;s d&rsquo;impression pour chaque mod&egrave;le.<br />\r\nNous avons aussi la possibilit&eacute; sur importation de vous proposer des USB publicitaire personnalisable &agrave; l&rsquo;extr&ecirc;me en forme de coupe, marque, message, visuel, objet&hellip;</p>',NULL,'2023-09-11 12:14:56','2023-09-14 10:45:39',23),(28,5,'Accessoires femmes','<p>Offrir un cadeau &agrave; une femme c&rsquo;est un symbole de remerciement pour ces efforts qu&rsquo;elle fait au quotidien.<br />\r\nPLANET DESIGN vous propose une s&eacute;lection d&rsquo;accessoires de bijouterie de fantaisie, porte-monnaie,<br />\r\ndes portes cl&eacute;s, des mugs et d&rsquo;autres gadgets &agrave; offrir en guise d&rsquo;estime.</p>',NULL,'2023-09-11 13:45:50','2023-09-14 10:46:46',29),(29,5,'Sport & voyages','<p>Pour les voyages comme dans les rencontres sportives, il n y a pas mieux qu&rsquo;un ballon de foot personnalisable ou une balle de golf ou des palettes de plage pour accompagner vos clients dans leurs moments de bonheur et de bien&ecirc;tre. Vous pouvez aussi profitez pour proposer des coffrets VIP porte documents de voyage ou tout simplement des reposes t&ecirc;tes.<br />\r\nNous vous proposons aussi des objets promotionnels pour faire passer votre message &agrave; grand &eacute;chelle tels que les des bracelets personnalisables &agrave; utiliser dans les grands events et h&ocirc;tels.</p>',NULL,'2023-09-11 16:28:20','2023-09-14 10:47:21',32),(30,5,'Enfants','<p>Offrir un cadeau &agrave; un enfant, c&rsquo;est comme offrir un tr&eacute;sor qui va le marquer lui mais aussi &agrave; ses parents. Nous vous proposons des objets promotionnels plaisants et pas chers pour combiner la joie, l&rsquo;utilit&eacute; et une communication cibl&eacute;e.</p>',NULL,'2023-09-13 12:03:19','2023-09-14 10:46:57',30),(31,5,'Sacs shopping & voyages','<p>Depuis que les sacs en plastique sont interdits, les sacs publicitaires en polypropyl&egrave;ne et en tissu sont devenus tr&egrave;s appr&eacute;ci&eacute;s et utilis&eacute;s par tout le monde et dans toutes les activit&eacute;s. Contrairement aux sacs en carton, les sacs en tissu sont r&eacute;sistants &agrave; l&rsquo;usage et ils sont m&ecirc;me lavables en gardant la personnalisation intacte apr&egrave;s plusieurs lavages.<br />\r\nD&eacute;couvrez nos mod&egrave;les et couleurs disponibles en stock.</p>',NULL,'2023-09-13 12:05:04','2023-09-14 10:46:37',28),(32,5,'Voitures & bricolages','<p>Notre gamme de gadgets pour voiture et bricolage, sont des gadgets tr&egrave;s utiles au quotidien et qui faciliteront la t&acirc;che &agrave; vos partenaires. Nous citons, des lampes torches pour une meilleure visibilit&eacute; ou tout simplement des torches &agrave; pile, des couteaux-suisse, des boites &agrave; tourne-vises sans oublier plusieurs mod&egrave;les de pare-soleil publicitaires.</p>',NULL,'2023-09-13 12:11:02','2023-09-14 10:46:26',27),(33,5,'été & plage','<p>A partir du printemps, les sorties &agrave; la plage et en piquenique se multiplient pour profiter du soleil et du bon temps.<br />\r\nA vous de faire profiter vos partenaire d&rsquo;une occasion pour se faire remarquer et &ecirc;tre f&eacute;d&eacute;rateur de la bonne humeur. Nous vous proposons des parasols personnalisables, des raquettes publicitaires, des gourdes d&rsquo;eau, des sacs isothermes, des petites bo&icirc;tes &agrave; repas, des ballons de foot&hellip;</p>',NULL,'2023-09-13 12:20:23','2023-09-14 10:47:09',31),(34,6,'Vêtements de travail','<p>Les v&ecirc;tements professionnels v&eacute;hiculent une visibilit&eacute; mobile ainsi qu&rsquo;une s&eacute;curit&eacute; &agrave; son porteur.<br />\r\nNous vous proposons des gilets de s&eacute;curit&eacute; en 2 gammes pour faire valoir une identit&eacute; visuelle &agrave; l&rsquo;ext&eacute;rieur et partout.</p>',NULL,'2023-09-13 12:57:45','2023-09-14 10:48:11',37),(35,6,'T-shirts & polos','<p>Pour vos &eacute;v&eacute;nements en interne comme en externe, Optez pour les T-shirts et polos publicitaires de la marque GUILDAN reconnue par la qualit&eacute; du grammage (100% coton) et la fa&ccedil;on.<br />\r\nPLANET DESIGN vous propose des t-shirt personnalisables pour adultes disponibles en stock en diff&eacute;rentes couleurs et tailles pour les &eacute;v&eacute;nements et les activations commerciales out-door.<br />\r\nAinsi, vous pouvez proposer nos polos de qualit&eacute; pour renforcer le sentiment d&rsquo;appartenance dans les &eacute;quipes et collaborateurs en associant l&rsquo;image de la marque avec la qualit&eacute; du tissu, de la couture et le prestige de nos polos en manches courtes et longues.</p>',NULL,'2023-09-13 12:59:15','2023-09-14 10:48:11',36),(36,6,'Autres textiles',NULL,NULL,'2023-09-13 15:51:39','2023-09-14 10:47:54',35),(37,5,'pharma & santé',NULL,NULL,'2023-09-14 09:44:51','2023-09-14 10:47:35',34),(38,5,'déco & maison',NULL,NULL,'2023-09-14 09:50:25','2023-09-14 10:47:35',33);
